import React, { Component } from 'react';
import { Menu, Icon } from 'antd';
import { Route, NavLink, Switch } from 'react-router-dom';

class LeftMenu extends Component {
  render() {
    return (
   <div>

   <div class="dropdown">
        <button class="btn dropdown-toggle" type="button" data-toggle="dropdown">Tutorials
        <span class="caret"></span></button>
        <ul class="dropdown-menu">
          <li class="dropdown-header">Dropdown header 1</li>
          <li><a href="#">HTML</a></li>
          <li><a href="#">CSS</a></li>
          <li><a href="#">JavaScript</a></li>
          <li class="divider"></li>
          <li class="dropdown-header">Dropdown header 2</li>
          <li><a href="#">About Us</a></li>
        </ul>
      </div>

      <li>
          <NavLink to = "/interview-corner"><a href=""  style = {{ color: "grey" }}>Interviews</a></NavLink>
      </li>
      <li>
      <NavLink to = "/new-jobs/" exact ><a href=""  style = {{ color: "grey" }}>
        New Job Openings</a></NavLink></li>
      <li>
        <NavLink to = "/interviews/new" exact>
          <a href=""  style = {{ color: "grey" }}>Add Interview</a>
        </NavLink>
      </li>
    </div>
    );
  }
}
export default LeftMenu;
